import './SwipeItem.css';

function SwipeItem({key, background, title, button}) {
    // return 빼먹으면 안된다.
    return (
        <div id={key} className='swipe-item' style={{backgroundImage: 'url({background})'}}>
        <img className="swiper-image">
        </img>
        <div>
            {title}
        </div>
        <button>
            {button}
        </button>
    </div>
    );
};

export default SwipeItem;
